// SPDX-License-Identifier: MIT
//
//    
//             
//              
//              
//              
//          
//        
//      
//
// https://endlesscrawler.io
// @EndlessCrawler
//
/// @title Endless Crawler Chapter Index
/// @author Studio Avante
/// @notice Manages Chapters contracts
/// @dev Depends on ICrawlerToken (chambers)
//
pragma solidity ^0.8.16;
import { Ownable } from '@openzeppelin/contracts/access/Ownable.sol';
import { IERC165 } from '@openzeppelin/contracts/utils/introspection/ERC165.sol';
import { Base64 } from '@openzeppelin/contracts/utils/Base64.sol';
import { ICrawlerIndex } from '../ICrawlerIndex.sol';
import { ICrawlerToken } from '../ICrawlerToken.sol';
import { ICrawlerChamberGenerator } from '../ICrawlerChamberGenerator.sol';
import { ICrawlerGenerator } from '../ICrawlerGenerator.sol';
import { ICrawlerMapper } from '../ICrawlerMapper.sol';
import { ICrawlerRenderer } from '../ICrawlerRenderer.sol';
import { MapV1 } from '../MapV1.sol';
import { Crawl } from '../Crawl.sol';

contract LimboIndex is Ownable, ICrawlerIndex, ICrawlerRenderer {

	ICrawlerToken public _tokenContract;

	Chapter private _chapter;

	constructor(address generator_, address mapper_) {
		_chapter = Chapter(0, ICrawlerGenerator(generator_), ICrawlerMapper(mapper_), ICrawlerRenderer(this));
	}

	//---------------
	// Admin
	//

	/// @notice Admin function
	function setTokenContract(address tokenContract_) public onlyOwner {
		_tokenContract = ICrawlerToken(tokenContract_);
	}

	/// @notice Admin function
	function setupChapter(address generator_, address mapper_, address renderer_) public onlyOwner {
		if(generator_ != address(0)) {
			_chapter.generator = ICrawlerGenerator(generator_);
		}
		if(mapper_ != address(0)) {
			_chapter.mapper = ICrawlerMapper(mapper_);
		}
		if(renderer_ != address(0)) {
			_chapter.renderer = ICrawlerRenderer(renderer_);
		}
	}

	//---------------
	// Public
	//

	/// @notice Get the current Chapter number
	/// @return chapterNumber
	function getCurrentChapterNumber() public view override returns (uint8) {
		return _chapter.chapterNumber;
	}

	/// @notice Get them current Chapter contracts
	/// @return chapter Structure containing contract addresses
	function getCurrentChapter() public view override returns (Chapter memory) {
		return _chapter;
	}

	/// @notice Get a Chapter's contracts
	// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @return chapter Structure containing contract addresses
	function getChapter(uint8 /*chapterNumber*/) public view override returns (Chapter memory) {
		return _chapter;
	}

	/// @notice Get the ICrawlerChamberGenerator contract
	/// @return generator contract address
	function getChamberGenerator() public view override returns (ICrawlerChamberGenerator) {
		return ICrawlerChamberGenerator(address(_chapter.generator));
	}

	/// @notice Get an ICrawlerGenerator contract
	// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @return generator contract address
	function getGenerator(uint8 /*chapterNumber*/) public view override returns (ICrawlerGenerator) {
		return _chapter.generator;
	}

	/// @notice Get an ICrawlerMapper contract
	// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @return mapper contract address
	function getMapper(uint8 /*chapterNumber*/) public view override returns (ICrawlerMapper) {
		return _chapter.mapper;
	}

	/// @notice Get an ICrawlerRenderer contract
	// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @return renderer contract address
	function getRenderer(uint8 /*chapterNumber*/) public view override returns (ICrawlerRenderer) {
		return _chapter.renderer;
	}


	//---------------------------------------
	// Token / Metadata calls
	//

	/// @notice Generate and returns everything about a chamber
	// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @param coord Chamber coordinate
	/// @param chamberSeed Chamber static data
	// @param generateMaps If True, will generate bitmap and tilemap (slower)
	/// @return result Crawler.ChamberData struct
	function getChamberData(uint8 /*chapterNumber*/, uint256 coord, Crawl.ChamberSeed memory chamberSeed, bool generateMaps) public view override returns (Crawl.ChamberData memory result) {
		result = getChamberGenerator().generateChamberData(coord, chamberSeed, false, _tokenContract, _chapter.generator);
		result.seed = uint256(keccak256(abi.encodePacked(blockhash(block.number-1), chamberSeed.tokenId)));
		result.chapter = 0;
		result.yonder = 0;
		result.hoard = Crawl.Hoard(Crawl.Gem.Kao, 0, 0);
		result.gemPos = uint8((result.seed >> 200) % 256);
		if (generateMaps) {
			result.bitmap = type(uint256).max;
			result.tilemap = new bytes(256);
			for(uint256 i = 0 ; i < 256 ; ++i) {
				result.tilemap[i] = MapV1.Tile_Path;
			}
			result.tilemap[result.gemPos] = MapV1.Tile_Gem;
		}
	}

	/// @notice Returns a Chamber metadata, without maps
	/// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @param coord Chamber coordinate
	/// @param chamberSeed Chamber static data
	/// @return metadata Metadata, as plain json string
	function getChamberMetadata(uint8 chapterNumber, uint256 coord, Crawl.ChamberSeed memory chamberSeed) public view override returns (string memory) {
		if (chamberSeed.tokenId == 0) return '{}';
		Crawl.ChamberData memory chamber = getChamberData(chapterNumber, coord, chamberSeed, false);
		return string.concat(
			'{'
				'"tokenId":"', Crawl.toString(chamber.tokenId), '",'
				'"name":"Limbo #', Crawl.toString(chamber.tokenId), '",'
				'"chapter":"', Crawl.toString(chamber.chapter), '",'
				'"terrain":"', Crawl.toString(uint256(chamber.terrain)), '",'
				'"gem":"', Crawl.toString(uint256(chamber.hoard.gemType)), '",'
				'"coord":"', Crawl.toString(chamber.coord), '",'
				'"yonder":"', Crawl.toString(chamber.yonder), '",'
				'"coord":"', Crawl.toString(chamber.coord), '",'
				'"yonder":"', Crawl.toString(chamber.yonder), '",',
				_chapter.renderer.renderAdditionalChamberMetadata(chamber, _chapter.mapper),
			'}'
		);
	}

	/// @notice Returns the seed and tilemap of a Chamber, used for world building
	/// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @param coord Chamber coordinate
	/// @param chamberSeed Chamber static data
	/// @return metadata Metadata, as plain json string
	function getMapMetadata(uint8 chapterNumber, uint256 coord, Crawl.ChamberSeed memory chamberSeed) public view override returns (string memory) {
		if (chamberSeed.tokenId == 0) return '{}';
		return _chapter.renderer.renderMapMetadata(getChamberData(chapterNumber, coord, chamberSeed, true), _chapter.mapper);
	}

	/// @notice Returns IERC721Metadata compliant metadata, used by tokenURI()
	/// @param chapterNumber The Chapter number, or 0 for current chapter
	/// @param coord Chamber coordinate
	/// @param chamberSeed Chamber static data
	/// @return metadata Metadata, as base64 json string
	function getTokenMetadata(uint8 chapterNumber, uint256 coord, Crawl.ChamberSeed memory chamberSeed) public view override returns (string memory) {
		if (chamberSeed.tokenId == 0) return '{}';
		return _chapter.renderer.renderTokenMetadata(getChamberData(chapterNumber, coord, chamberSeed, true), _chapter.mapper);
	}

	//--------------------
	// ICrawlerRenderer
	//

	/// @dev implements IERC165
	function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
		return interfaceId == type(ICrawlerRenderer).interfaceId;
	}

	/// @notice Returns aadditional metadata for CrawlerIndex.getChamberMetadata()
	// @param chamber The Chamber, without maps
	// @param mapper The ICrawlerMapper contract address
	/// @return metadata Metadata properties
	function renderAdditionalChamberMetadata(Crawl.ChamberData memory chamber, ICrawlerMapper mapper) public view virtual override returns (string memory) {
		return string.concat('"image":"data:image/svg+xml;base64,', Base64.encode(bytes(_renderSvg(chamber, mapper))), '"');
	}

	/// @notice Returns the seed and tilemap of a Chamber, used for world building
	/// @param chamber The Chamber, with maps
	/// @param mapper The ICrawlerMapper contract address
	/// @return metadata Metadata, as plain json string
	function renderMapMetadata(Crawl.ChamberData memory chamber, ICrawlerMapper mapper) public view virtual override returns (string memory) {
		string[] memory colors = mapper.getColors(chamber.terrain);
		require(colors.length >= 5, 'Incomplete color palette');
		return string.concat(
			'{'
				'"seed":"', Crawl.toHexString(chamber.seed, 32), '",'
				'"tilemap":"data:application/octet-stream;base64,', Base64.encode(chamber.tilemap), '",'
				'"colors":{'
					'"background":"', colors[MapV1.Color_Background], '",'
					'"path":"', colors[MapV1.Color_Path], '",'
					'"tiles":"', colors[MapV1.Color_Tiles], '",'
					'"shadows":"', colors[MapV1.Color_Shadows], '",'
					'"player":"', colors[MapV1.Color_Player], '",'
					'"gem":"', mapper.getGemColor(chamber.hoard.gemType), '",'
					'"coin":"', mapper.getGemColor(Crawl.Gem.Coin), '"'
				'}'
			'}'
		);
	}

	/// @notice Returns IERC721Metadata compliant metadata, used by tokenURI()
	/// @param chamber The Chamber, with maps
	/// @param mapper The ICrawlerMapper contract address
	/// @return metadata Metadata, as base64 json string
	/// @dev Reference: https://docs.opensea.io/docs/metadata-standards
	function renderTokenMetadata(Crawl.ChamberData memory chamber, ICrawlerMapper mapper) public view virtual override returns (string memory) {
		string memory bgColor = mapper.getColor(chamber.terrain, MapV1.Color_Background);
		string memory svg = _renderSvg(chamber, mapper);
		string memory animation = string.concat(
			'<!DOCTYPE html>'
			'<html lang="en">'
				'<head>'
					'<meta charset="UTF-8">'
					'<meta name="author" content="Studio Avante">'
					'<title>Endless Limbo #', Crawl.toString(chamber.tokenId), '</title>'
					'<style>'
						'body{background:#', bgColor, ';margin:0;overflow:hidden;}'
						'#Player{transition:x 0.1s ease-in,y 0.1s ease-in;visibility:visible!important;animation:blinker 1s ease-in infinite;}'
						'@keyframes blinker{75%{opacity:1;}100%{opacity:0;}}'
					'</style>'
				'</head>'
				'<body>',
					svg,
					'<script>'
						'let p=document.getElementById("Player"),g=document.getElementById("Gem"),gp=-1;function m(t,e,i,r="moved"){let $=parseInt(p.getAttribute("x"))+e,l=parseInt(p.getAttribute("y"))+i;if($>=0&&l>=0&&$<16&&l<16){p.setAttribute("x",$),p.setAttribute("y",l);let n=$==gp[0]&&l==gp[1]?4:255;g.setAttribute("opacity",4==n?"1":"0"),window.parent.postMessage(JSON.stringify({limbo:{event:r,x:$,y:l,tile:n}}),"*")}t?.preventDefault()}window.onload=t=>{let e=document.querySelector("svg");e.setAttribute("height","100vh"),e.setAttribute("width","100vw"),gp=[parseInt(g.getAttribute("x")),parseInt(g.getAttribute("y"))],document.addEventListener("keydown",t=>{if(t.repeat)return;let e=t.keyCode;37==e&&m(t,-1,0),38==e&&m(t,0,-1),39==e&&m(t,1,0),40==e&&m(t,0,1),(13==e||32==e)&&m(t,0,0,"action")}),m(null,0,0)};'
					'</script>'
				'</body>'
			'</html>'
		);

		//
		// Generate JSON
		string memory external_url = string.concat('https://endlesscrawler.io/limbo/', Crawl.toString(chamber.tokenId));
		string[] memory labels = new string[](5);
		string[] memory values = new string[](5);
		labels[0] = 'Chapter';
		values[0] =  Crawl.toString(chamber.chapter);
		labels[1] = 'Terrain';
		values[1] = mapper.getTerrainName(chamber.terrain);
		labels[2] = 'Yonder';
		values[2] = Crawl.toString(chamber.yonder);
		labels[3] = 'Gem';
		values[3] = mapper.getGemName(chamber.hoard.gemType);
		labels[4] = 'Coordinate';
		values[4] = Crawl.coordsToString(chamber.coord, chamber.yonder, '');
		bytes memory json = bytes(string.concat(
			'{'
				'"name":"Limbo #', Crawl.toString(chamber.tokenId), '",'
				'"description":"Endless Limbo #', Crawl.toString(chamber.tokenId), '",'
				'"external_url":"', external_url, '",'
				'"background_color":"', bgColor, '",'
				'"attributes":[', Crawl.renderAttributesMetadata(labels, values), '],'
				'"image":"data:image/svg+xml;base64,', Base64.encode(bytes(svg)), '",'
				'"animation_url":"data:text/html;base64,', Base64.encode(bytes(animation)), '"'
			'}'
		));

		return string.concat('data:application/json;base64,', Base64.encode(json));
	}

	function _renderSvg(Crawl.ChamberData memory chamber, ICrawlerMapper mapper) public view returns (string memory) {
		string[] memory colors = mapper.getColors(chamber.terrain);
		require(colors.length >= 5, 'Incomplete color palette');
		uint8 playerPos = uint8((chamber.seed >> 210) % 256);
		return string.concat(
			'<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" version="1.1" width="600" height="600" viewBox="-2 -2 20 20">'
				'<defs>'
					'<style>',
						':root{'
							'--Bg:#', colors[MapV1.Color_Background], ';'
							'--Paths:#', colors[MapV1.Color_Path], ';'
							'--Player:#', colors[MapV1.Color_Player], ';'
							'--Gem:#', mapper.getGemColor(chamber.hoard.gemType), ';'
						'}'
						'svg{background-color:var(--Bg);}'
						'.Bg{fill:var(--Bg);}'
						'#Paths{fill:var(--Paths);}'
						'#Player{fill:var(--Player);visibility:hidden;}'
						'#Gem{fill:var(--Gem);}'
					'</style>'
				'</defs>'
				'<g>'
					'<rect class="Bg" x="-2" y="-2" width="20" height="20"/>'
					'<rect id="Paths" x="0" y="0" width="16" height="16"/>'
					'<rect id="Player" x="', Crawl.toString(playerPos%16), '" y="', Crawl.toString(playerPos/16), '" width="1" height="1"/>'
					'<path id="Gem" x="', Crawl.toString(chamber.gemPos%16), '" y="', Crawl.toString(chamber.gemPos/16), '" d="m ', Crawl.toString(chamber.gemPos%16), ' ', Crawl.toString(chamber.gemPos/16), '.5 l 0.5 0.5 l 0.5 -0.5 l -0.5 -0.5 Z" />'
				'</g>'
			'</svg>'
		);
	}

}

